import axios from "axios";

export const apiCall = (method, endpoint, data) => {
    return (
        axios({
            method: { method },
            url: `https://60eeb0f2eb4c0a0017bf45ad.mockapi.io/${endpoint}`,
            data: { data }
        }).catch((err) => {
            console.log(err);
        })
    )
}
